import axios from 'axios';
import React, { useState } from 'react'

const VendorInsert = () => {

    const [name,setName]=useState();
    const [number,setNumber]=useState();
    const [add,setAdd]=useState();
    const onSubmit=()=>{
        const vendor={name:name,phone:number,add:add};
       axios.post("http://localhost:3001/vendor",vendor).then(
           res=>{
               console.log(res);

           }
       ).catch(err=>{
           console.log(err);
       })
    }
  return (
    <div>
        <form>
            <div className='form-group'>
            <label>Vendor Name</label>
            <input type="text"  className='form-control' onChange={(e)=>setName(e.target.value)}/>
            </div>
            <div className='form-group'>
            <label>Vendor Phone</label>
            <input type="number"   className='form-control' onChange={(e)=>setNumber(e.target.value)} />
            </div>
            <div className='form-group'>
            <label>Vendor Address</label>
            <input type="text" className='form-control' onChange={(e)=>setAdd(e.target.value)}/>
            </div>
            <div className='form-group'>
            <button type="submit" className='btn btn-primary' onClick={onSubmit}>Submit</button>
            </div>
        </form>

    </div>
  )
}

export default VendorInsert
